import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LandingPage from './components/LandingPage';
import RegistrationPage from './components/RegistrationPage';
import HackathonMainPage from './components/HackathonMainPage';
import TrackPage from './components/TrackPage';
import SchedulePage from './components/SchedulePage';
import MySubmissionsPage from './components/MySubmissionsPage';
import RulebookPage from './components/RulebookPage';
import ProfilePage from './components/ProfilePage';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/register" element={<RegistrationPage />} />
        <Route path="/hackathon" element={<HackathonMainPage />} />
        <Route path="/tracks/:trackId" element={<TrackPage />} />
        <Route path="/schedule" element={<SchedulePage />} />
        <Route path="/submissions" element={<MySubmissionsPage />} />
        <Route path="/rulebook" element={<RulebookPage />} />
        <Route path="/profile" element={<ProfilePage />} />
      </Routes>
    </Router>
  );
};

export default App;
